import React from 'react'


export default function CardStarships({title,info}){

    return (
        <div>
            <div className='Card'>
                <h2>{title ? title : null}</h2>
                <div>
                    {info ? 
                        <h4>Model: {info.model}</h4>
                    :null}
                </div>
            </div>
        </div>
    )
}
